import './App.css';
import Navbar from './components/Navbar';

function App() {
  return (
    <>
    <Navbar></Navbar>
    <div className="container align-items-centre">
    <img src="https://alpineriverhill.com/assets/img/slider/1.jpg" alt="React Image" />
    </div>
    </>
  );
}

export default App;
